css:
@-moz-document url("https://www.tumblr.com/dashboard") {
\\gray mid\\666666
.post,
.post_full{
    background: #666666 !important;
}

\\gray dark\\444444
.l-container.l-container--two-column-dashboard,
.l-content,
.l-container.l-container--two-column,
.l-content,
#dashboard_index {
    background-color: #444444 !important;
}
\\gray transparent 

\\black
a, body {
    color: #000 !important;
}
\\yellow 
.post_control.like.liked {
    color: #ffeda6 !important;
}
.compose-button {
    fill: #ffeda6 !important;
}
.tab_notice,
.post-source-footer,
.audio-player{
    background: #ffeda6 !important
}
\\nothing 
\\background-color 
.l-header-container,
.l-header-container--refresh,
.l-container.l-container--two-column-dashboard,
.left_column,
.post_avatar {
    background-color: rgba(54, 70, 93, 0) !important;
}
\\background 
.identity,
.right_column:after,
.l-container.l-container--two-column,
.right_column,
.post_container,
.post_full .post.post_full,
.post_wrapper,
.post_controls .post_control.reblog.reblogged:after {
    background: rgba(54, 70, 93, 0) !important;
}
\\box shadow
.l-header-container,
.l-header-container--refresh {
    box-shadow: 0 0 0 0 !important;
}
.tab_bar, .tab_anchor{
    color: none !important;
}
\\\misc
.post_control.post-control-icon,
.share {
    display: inline-block !important;
}
}
